  cervice.getAllItems().then(res => console.log(res))
  cervice.getItem(10).then(res => console.log(res))
  let interesting;
  cervice.getItem(10).then(res => interesting = res)

  // Promise.all([...cervice.getAllItems()]).then(res => console.log(res))
